import FlashCard from "../components/FlashCard";

function FlashCards() {
  return (
    <div
      style={{
        width: "100%",
        aspectRatio: 2,
        justifyContent: "center",
        alignItems: "center",
        display: "flex",
      }}
    >
      <FlashCard word={"helloooooo"} translation={"hallo"}></FlashCard>
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          fontSize: 100,
          backgroundColor: "#e7c0ff",
          borderRadius: 40,
          padding: 100,
          height: 400,
          cursor: "pointer",
        }}
      >
        yes
      </div>
    </div>
  );
}
export default FlashCards;
